import { Input, Switch } from 'antd';
import styles from './style.module.scss';
const { TextArea } = Input;


const Banner = (props) => {
    console.log(props, 'props');
    const { attributes = {}, changeTempPageChildAttribute } = props;
    const { myName, description, showSmallPic, smallPic, backPic } = attributes;
    console.log(attributes);
    return (
        <div>
            <div className={styles.row}>
                <span className={styles.label}>小站名字</span>
                <Input
                    value={myName}
                    className={styles.content}
                    placeholder="请输入小站名字"
                    onChange={(e) => { changeTempPageChildAttribute('myName', e.target.value) }}
                />
            </div>
            <div className={styles.row}>
                <span className={styles.label}>小站简介</span>
                <TextArea
                    value={description}
                    className={styles.content}
                    rows={2}
                    placeholder="请输入小站简介"
                    onChange={(e) => { changeTempPageChildAttribute('description', e.target.value) }}
                />
            </div>
            <div className={styles.row}>
                <span className={styles.label}>背景图片</span>
                <Input
                    value={backPic}
                    className={styles.content}
                    placeholder="请输入背景图片链接"
                    onChange={(e) => { changeTempPageChildAttribute('backPic', e.target.value) }}
                />
            </div>
            <div className={styles.row}>
                <span className={styles.label}>展示头像</span>
                <Switch checked={showSmallPic} onChange={(checked) => { changeTempPageChildAttribute('showSmallPic', checked) }} />
            </div>
            {
                showSmallPic?(<div className={styles.row}>
                    <span className={styles.label}>你的头像</span>
                    <Input
                        value={smallPic}
                        className={styles.content}
                        placeholder="请输入头像图片链接"
                        onChange={(e) => { changeTempPageChildAttribute('smallPic', e.target.value) }}
                    />
                </div>):null
            }
            
            

        </div>
    )
}

export default Banner;
